[Form]
public class ProdRouteJobCurrent extends FormRun
{
    ProdRouteTransCache jobCache;
    ProdRouteTransCache oprCache;

    PmfFormCtrl_ProdRouteJobCurrent pmfFormCtrl_ProdRouteJobCurrent;

}

void init()
{
    pmfFormCtrl_ProdRouteJobCurrent = PmfFormCtrl_ProdRouteJobCurrent::newFromForm(element);

    super();

    if (element.args().parm() == '2')
        element.doVisibleJobPage(false);

    if (element.args().parm() == '1')
    {
        element.doVisibleOperationPage(false);
        element.doVisibleJobPage(false);
    }

    jobCache = ProdRouteTransCache::constructJob();
    oprCache = ProdRouteTransCache::constructOpr();

    pmfFormCtrl_ProdRouteJobCurrent.setDatasources(prodTable);
    pmfFormCtrl_ProdRouteJobCurrent.initPost();

    if (ProdApplyUserTimezoneOffsetFlight::instance().isEnabled())
    {
        this.showDateTimeWithUserTimezone(ProdParameters::find().ShowSchedDateTimeWithUserTimeZone);
    }
}

private void showDateTimeWithUserTimezone(boolean showWithTimezone)
{
    Scheduled.visible(!showWithTimezone);
    ScheduledTimezone.visible(showWithTimezone);

    DateScheduled.visible(!showWithTimezone);
    DateScheduledTimezone.visible(showWithTimezone);
}

public void run()
{
    ProdRouteJobCurrentFormTabId prodRouteJobCurrentFormTabId;
    super();

    if (element.args().parm() == '3')
    {
        prodRouteJobCurrentFormTabId = element.args().parmEnum();

        switch (prodRouteJobCurrentFormTabId)
        {
            case ProdRouteJobCurrentFormTabId::OperationTab :
                ctrlOperation.setFocus();
                break;

            case ProdRouteJobCurrentFormTabId::ProductionTab :
                ctrlProduction.setFocus();
                break;
            default:
                break;
        }
    }
}

public void init()
{
    super();

    this.cacheAddMethod(tablemethodstr(ProdRouteJob, pdsCWQtyGood));
    this.cacheAddMethod(tablemethodstr(ProdRouteJob, pdsCWQtyError));
}

public int active()
{
    int ret;

    ret = super();

    pmfFormCtrl_ProdRouteJobCurrent.dataSourceActivePost();

    return ret;
}

